import React, { Component } from 'react';
import '../Styles/Profile.css';
import UniversityData from './UniversityData';
import UT from '../static_resources/ut_austin.png';
import UCB from '../static_resources/uc_berkeley.png';
import UW from '../static_resources/uw_seattle.png';

class UniversityProfile extends Component {
  render() {
    const ut_austin = {
      name: 'University of Texas - Austin',
      acceptanceRate: '36.5%',
      popMajor: 'Biology',
      type: 'Public',
      tuition: '$11,153',
      setting: 'Urban',
      sportsDivision: 'D1',
      gradSalary: '$55,052',
      gradRate: '79.1%',
      retentionRate: '95.0%',
      ratio: '19:1',
      religion: 'None',
      demographics: 'Very Diverse',
      image: UT,
    };
    const uc_berkeley = {
      name: 'University of California - Berkeley',
      acceptanceRate: '17.1%',
      popMajor: 'Computer Engineering',
      type: 'Public',
      tuition: '$13,351',
      setting: 'Urban',
      sportsDivision: 'D1',
      gradSalary: '$67,288',
      gradRate: '74.2%',
      retentionRate: '93.1%',
      ratio: '22:1',
      religion: 'None',
      demographics: 'Diverse',
      image: UCB,
    };
    const uw_seattle = {
      name: 'University of Washington - Seattle',
      acceptanceRate: '55.2%',
      popMajor: 'Computer Science',
      type: 'Public',
      tuition: '$12,377',
      setting: 'Urban',
      sportsDivision: 'D1',
      gradSalary: '$62,426',
      gradRate: '66.7%',
      retentionRate: '88.5%',
      ratio: '17:1',
      religion: 'None',
      demographics: 'Somewhat Diverse',
      image: UW,
    };
    const university_name = this.props.match.params.universityname;

    if (university_name === 'ut_austin') {
      return (
        <div>
          <UniversityData univ={ut_austin} />
        </div>
      );
    } else if (university_name === 'uc_berkeley') {
      return (
        <div>
          <UniversityData univ={uc_berkeley} />
        </div>
      );
    } else {
      return (
        <div>
          <UniversityData univ={uw_seattle} />
        </div>
      );
    }
  }
}

export default UniversityProfile;
